Stars! is a complex turn-based computer game based around the management of planets and fleets of spaceships following the 4X game model (eXplore, eXpand, eXploit &amp; eXterminate). The game has been around since 1995, and still has a strong following.

The torrent includes the final version of the game (2.70j RC3), full documentation, and 22 serial codes so you can play with many friends.
